const FrameworkGrid = () => {
  const mousePositionX: any = useMotionValue(0);
  const mousePositionY: any = useMotionValue(0);

  function handleMouseMove({ clientX, clientY }: { clientX: number; clientY: number }) {
    mousePositionX.set(clientX);
    mousePositionY.set(clientY);
  }

  return (
    <div onMouseMove={handleMouseMove}>
      {/* Framework Cards */}
      <div className="grid grid-cols-1 gap-4 sm:grid-cols-2 md:grid-cols-3">
        {frameworks.map((framework, index) => (
          <ServiceCard
            key={index} // Use index as a key for the outer card
            parentMousePositionX={mousePositionX}
            parentMousePositionY={mousePositionY}
            className="flex flex-col items-center rounded-lg border p-4 shadow-lg"
          >
            {/* <h3 >{framework.category}</h3> */}
            <ServiceCardPrice>{framework.category}</ServiceCardPrice>
            <div className="mt-10 flex items-center justify-around">
              {framework.items.map((item) => (
                <div
                  key={item.name}
                  className="mb-2 items-center justify-center text-center"
                >
                  <img
                    src={item.logo}
                    alt={`${item.name} logo`}
                    className="w-90 mx-auto h-8" // Adjust size as needed
                  />
                  {/* <span>{item.name}</span> */}
                </div>
              ))}
            </div>
          </ServiceCard>
        ))}
      </div>
    </div>
  );
};

export default FrameworkGrid;
